package com.auxiliary.designer.command;public abstract class Doer {    protected String name;    public abstract String doSome();}class CodeWorker extends Doer{    public CodeWorker(String name) {        super.name = name;    }    @Override    public String doSome() {        return "do it everyday and everyneight";    }}class TestWorker extends Doer{    public TestWorker(String name) {        super.name = name;    }    @Override    public String doSome() {        return "enjoy every happy day";    }}